import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';



const style = {
    paper: {
        padding : "15px",
        margin : "5px",
        marginBottom : "10px"
    }
}

export default function Content() {
    return (
        <div>
        <Grid container>
            <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "button" color = "black">Left Panel
                    </Typography>
                </Paper>
        </Grid>
        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "button" color = "black">Right Panel
                    </Typography>
                </Paper>
        </Grid>

        </Grid>
        </div>
    )
}
